for (var rowIndex = 0; rowIndex < c.rowCount; rowIndex++) {
    for (var colIndex = 0; colIndex < c.colCount; colIndex++) {
        c.cols[colIndex].rows[rowIndex].eeChildren[0].style.visibility = "hidden";
        c.cols[colIndex].rows[rowIndex].eeChildren[0].mainIndex = rowIndex * c.colCount + colIndex;
        c.cols[colIndex].rows[rowIndex].userText = "";
        c.cols[colIndex].rows[rowIndex].onclick = function() {
            //this.eeChildren[0].style.visibility = "visible";
            ee.setEditText(ee.getControl("edit1"), this.userText);
            ee.showAni(ee.getControl("panel23"));
            ee.getControl("panel23").cell = this;
        }
        ee.setTableCellText(c, colIndex, rowIndex, d);
        d++;
        if (d>31) {
            d = 1;
            flag ++;
        }
        if (d>30) {
            if (flag>0) d=1;
        }
    }
}
