g5.initLightButton = function(controlName) {
    var p = ee.getControl(controlName);
    var c = createPanel(p, "ee_tempXXX", "", 0, 0, 1, 1);
    ee.setImage(c, ee.pageUrl + "/light.png", "trim");
    eb.setDock(c, "fill", "fill");
    c.style.visibility = "hidden";
    c.onmouseleave = function() {
        this.style.visibility = "hidden";
    }
    p.onmouseenter = function () {
        this.eeChildren[0].style.visibility = "visible";
    }
    c.onclick = function () {
        alert("本页面仅做展示，后续页面禁止进入！");
        //window.location.href = ee.pageRoot + "/temp/ncDemo/na";
    }
    p.autoani = true;
    p.style.visibility = "hidden";
}

